function countingValleys(steps, path) {
  let level = 0;
  let valleyUp = 0;
  let up = true;

  path = Array.from(path);

  if (path[0] === "D") {
    up = false;
  }

  path.forEach((step) => {
    if (step === "D") {
      level--;
    } else if (step === "U") {
      level++;
    }
    if (level > 0) {
      up = true;
    } else if (level < 0) {
      up = false;
    }
    if (level === 0 && up === false) {
      valleyUp++;
    }
  });

  return valleyUp;
}

console.log(
  countingValleys(
    9,

    ""
  )
);
